# coding=utf-8

class Solution(object):
    def findTheDifference(self, s, t):
        """
        :type s: str
        :type t: str
        :rtype: str
        """
        temp = 0
        for i in s:
            temp = temp ^ ord(i)
        
        result = 0
        for i in t:
            result = result ^ ord(i)
        
        result = temp ^ result
        return chr(result)   

